import React from 'react';
import Scrollspy from 'react-scrollspy';
import '../Css/Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        <div className="navbar-logo">
          <a href="#hero">My Portfolio</a>
        </div>
        {/* Use Scrollspy to watch for these section IDs and add the 'active' class to the matching link */}
        <Scrollspy
          items={['hero', 'about', 'projects', 'contact']}
          currentClassName="active"
          className="navbar-links"
          offset={-80}  // offset to account for your sticky navbar height (adjust as necessary)
        >
          <li><a href="#hero">Home</a></li>
          <li><a href="#about">About</a></li>
          <li><a href="#projects">Projects</a></li>
          <li><a href="#contact">Contact</a></li>
        </Scrollspy>
      </div>
    </nav>
  );
};

export default Navbar;
